            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Devant l’accroissement des sociétés de services et de commerce au Burkina Faso, une main-d’œuvre spécialisée et formée en marketing est
                    requise sur le marché du travail. Le Master en Marketing & Management International (MMI), d’une durée de deux ans, répond à ce besoin.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""descriptio");
            WriteLiteral(@"n""> 
                    Ce Master spécialité Marketing et Management International a vocation à former des managers directement opérationnels dans les entreprises
                    afin de les aider dans leur projet d’internationalisation. Il s’adresse à des étudiants qui disposent déjà d’une formation générale à la gestion et qui
                    ont un bon niveau d’anglais. L’accent est placé sur les dimensions marketing et stratégique, sans négliger les autres aspects d’une démarche
                    d’internationalisation.
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Les étudiants titulaires de ce Master pourront donc intervenir comme cadres (en interne) ou comme consultants (en externe). Leurs missions
                    pourront aller dans un pays tiers en passant par la recherche de partenaires afin de.");
            WriteLiteral(@" :
                </p>
                <ul class=""one_list"">
                    <li> 
                        Conduire une étude de marché
                    </li>
                    <li> 
                        Elaborer les stratégies et de mettre en œuvre un plan marketing
                    </li>
                    <li> 
                        Créer un réseau de distribution
                    </li>
                    <li> 
                        Accompagner les entreprises dans leurs projets d’internationalisation
                    </li>
                    <li> 
                        Superviser de projets internationaux.
                    </li>
                </ul>


                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    Le programme de Master en Marketing & Management International prépare au parcours Gestion des organisations internationales et aux
                    carrières d");
            WriteLiteral(@"e l’entreprise privée avec une ouverture sur l’entreprenariat.
                </p>

            </div>

